:root {
    --animate-duration: 1s;
    --animate-delay: 1s;
    --animate-repeat: 1
}

.animate__animated {
    animation-duration: 1s;
    animation-duration: var(--animate-duration);
    animation-fill-mode: both
}

@keyframes fadeIn {
    0% {
        opacity: 0
    }

    to {
        opacity: 1
    }
}

@keyframes fadeInUp {
    0% {
        opacity: 0;
        transform: translate3d(0, 100%, 0)
    }

    to {
        opacity: 1;
        transform: translateZ(0)
    }
}

@keyframes slideInDown {
    0% {
        transform: translate3d(0, -100%, 0)
    }

    to {
        transform: translateZ(0)
    }
}

@keyframes bounce {

    0%,
    to {
        transform: translateY(0) rotate(var(--rotation-angle))
    }

    50% {
        transform: translateY(-10px) rotate(var(--rotation-angle))
    }
}

.animate__fast {
    animation-duration: .22s
}

.animate__easeIn {
    animation-timing-function: ease-in
}

.animate__fadeIn {
    animation-name: fadeIn
}

.animate__fadeInUp {
    animation-name: fadeInUp
}

.animate__slideInDown {
    animation-name: slideInDown
}

.animate__bounce {
    animation-name: bounce;
    animation-timing-function: ease;
    animation-iteration-count: infinite;
    animation-fill-mode: forwards
}

.animate-spin-ease-in-out {
    animation: spin .7s cubic-bezier(.4, 0, .2, 1) 1
}

.animate-rotate-by-step {
    -webkit-animation-name: rotate-steps;
    -webkit-animation-duration: 6.5s;
    -webkit-animation-iteration-count: infinite;
    -webkit-transition-timing-function: ease-in-out
}

